    true,nt"url": null,nt"notes": "<p>This look-up tool is a searchable database
    that allows you to look up a provider by National Provider Identifier (NPI), or
    by name and location. The look-up tool will return information on services and procedures
    provided to Medicare beneficiaries, including utilization information, payment amounts
    (allowed amount and Medicare payment), and submitted charges organized by Healthcare
    Common Procedure Coding System (HCPCS) code. The data covers calendar year 2012
    and contains 100 percent final-action physician-supplier Part B non-institutional
    line items for the Medicare fee-for-service population (information is redacted
    where necessary to protect beneficiary privacy).</p>n",nt"license_title": "Other
